import React, {useState} from "react"

import { ProductsBlock_v2, SearchHeader } from './index'

function AboutProducts({items}) {

  const [search, setSearch] = useState('')
  const [activeItem, setActiveItem] = useState(null)

  const onActivePage = (index) => {
    setActiveItem(index);
  }

  return (
    <div>
        <SearchHeader 
        onSearch = {setSearch}
        name={items.name}/>
      <div className={activeItem === null ? "block-cards" : "block-cards w-100"}>
          {
            items.filter(category=>category.products.find(product=>product.name.toLowerCase().includes(search.toLowerCase())
              )).map((obj) => 
            <ProductsBlock_v2 
              imgsrc = {obj.imgsrc}
              search = {search}
              title={obj.category}
              data={obj.products}/>
            )
          }
      </div>
    </div>
  )
}

export default AboutProducts
